        console.log(this.props)
        const response = await axios('https://jsonplaceholder.typicode.com/todos');
        return  {todos : response.data}
    }

    render() {
        console.log(this.props)
        return (
            <div>
                <Navbar/>
                <h1>sdfg</h1>
            </div>
        );
    }
}

export default Index;
